        // }, []);

        // return (
        //     {itemsData, getItemData:handleDataFetch}
        // )
    },

    useNexomon: async () => {
        const result = await server_calls.nexomon();
        return result;
    },

    useStatus: async () => {
        const result = await server_calls.status();
        return result;
    },

    useType: async () => {
        const result = await server_calls.type();
        return result;
    },

    useVault: () => {
        return (server_calls.vaults());
    }
}
